import React, { Component } from "react";
import p5 from "p5";
import Sim1 from './sketch1'
import P5Wrapper from "./P5Wrapper";


class Simulations extends Component {


    render() {
    return (
        <React.Fragment>
         <P5Wrapper
             sketch={Sim1}
             slider={10}
         />
         <button className="btn btn-dark m-2">Select</button>
        </React.Fragment>
    );
  }


}

export default Simulations;
